import '../styles/Rating.css'

function Rating (props){
    const stars = props.starsNumber;

    const RATING = new Array(5).fill(<p>0</p>);

    for(let i = 0 ; i < stars ; i++){
        RATING[i] = <p>1</p>
    }
    return (
        <div>
            {RATING}
        </div>
    )
}

export default Rating
